static startRecordBatch(builder:flatbuffers.Builder) {
  builder.startObject(4);
}

static addLength(builder:flatbuffers.Builder, length:flatbuffers.Long) {
  builder.addFieldInt64(0, length, builder.createLong(0, 0));
